(1, 'CNmGtlAjpty', 2147483647, 'Ramadan Kareem to all of our Muslim friends.☪️\n\nMay this holy month be filled with happiness, harmony and peace.\n\nFrom Platinum Code Team. 😊\n\n#digitalmarketing #contentmarketing #marketing #marketingstrategy #marketingdigital #marketingtips #marketingagency #marketingideas #branding #brandingdesign #brandingagency #socialmediatips #socialmediastrategy #socialmediamarketing #socialmediamanager #socialmediamarketing #advertising #advertisingagency #onlinemalaysia #malaysiaonlineshop #malaysiatrulyasia #igreviewmalaysia #viralmalaysia #malaysia #malaysiaku #malaysiaphotographer #kualalumpur #platinumcode #DONE4U', 'https://www.instagram.com/p/CNmGtlAjpty/', 'https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/172474951_2272089089593394_5438786454141719087_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=QO_bDSZJjdgAX8MuUmh&edm=ABfd0MgBAAAA&ccb=7-4&oh=00_AT-MUjXkGGcSM0ZgxrPvrqTCBkQbGeFBJ4DkHPiHIggsMA&oe=62874703&_nc_sid=7bff83', -1, '2021-04-13 02:03:36'),
(2, 'CLLRLF4ld-X', 2147483647, 'Gong Xi Fa Chai! 🎉\n\nHappy Chinese New Year to all of you! 🎊\n\nIn this Year of the Ox, we would like to extend our wishes to you and your family in having a healthy, wealthy and prosperous year ahead. 💰💰\n\nFrom Platinum Code Team.\n\n#GongXiFaCai\n#HappyChineseNewYear\n#PlatinumCode\n#YearOfTheOx', 'https://www.instagram.com/p/CLLRLF4ld-X/', 'https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/149790627_746868609558139_3892700513451457714_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=107&_nc_ohc=w7DJcZ1wXNQAX9DDg2O&tn=bJ8ylPB-l1eZ-Ffk&edm=ABfd0MgBAAAA&ccb=7-4&oh=00_AT_5L2N12-t2qQniwelNZXe5vXJLPIXc4Ws8WlkeBDwiqg&oe=6286E98F&_nc_sid=7bff83', -1, '2021-02-12 10:52:44'),
(3, 'CKk1wG2Aevo', 2147483647, 'Platinum Code wishes everyone a blessed Thaipusam. \n\nLet us continue to foster unity and preserve the country’s harmony and prosperity.\n\nStay at home and stay safe. Looking to digitise your business? Look no further, consult us now.\n\n#thaipusam #digitalmarketing #contentmarketing #marketing #marketingstrategy #marketingdigital #marketingtips #marketingagency #marketingideas #branding #brandingdesign #brandingagency #socialmediatips #socialmediastrategy #socialmediamarketing #socialmediamanager #socialmediamarketing #advertising #advertisingagency #onlinemalaysia #malaysiaonlineshop #malaysiatrulyasia #igreviewmalaysia #viralmalaysia #malaysia #malaysiaku #malaysiaphotographer #kualalumpur #platinumcode #DONE4U', 'https://www.instagram.com/p/CKk1wG2Aevo/', 'https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/143769119_2754757091457107_8699819241506815370_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=111&_nc_ohc=qGU-JiRcFbUAX-B83gQ&tn=bJ8ylPB-l1eZ-Ffk&edm=ABfd0MgBAAAA&ccb=7-4&oh=00_AT8njZ4fdn9cXLGuy2YoSquKdtT0U0EdGB5a00pW7_qiIQ&oe=628CB89C&_nc_sid=7bff83', -1, '2021-01-28 12:41:46'),
(4, 'CJ-x2CssZZF', 2147483647, 'Stay home, stay safe! We have flattened the curve before, we can do it again.\n\nAt times like these, we need to watch out for one another. Need help in getting your business online? \n\nContact us today and get your first free digital transformation consultation!\n\n#MCO #CMCO #digitalmarketing #contentmarketing #marketing #marketingstrategy #marketingdigital #marketingtips #marketingagency #marketingideas #branding #brandingdesign #brandingagency #socialmediatips #socialmediastrategy #socialmediamarketing #socialmediamanager #socialmediamarketing #advertising #advertisingagency #onlinemalaysia #malaysiaonlineshop #malaysiatrulyasia #igreviewmalaysia #viralmalaysia #malaysia #malaysiaphotographer #kualalumpur #platinumcode #DONE4U', 'https://www.instagram.com/p/CJ-x2CssZZF/', 'https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/138299305_461078561961993_3326318074709136719_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=ST8VnKOeDykAX95XSW9&edm=ABfd0MgBAAAA&ccb=7-4&oh=00_AT-GbZlBceX9Rq5AlFkjKZSDWxNejWU2ghgCgrztii2IIQ&oe=628C51AA&_nc_sid=7bff83', -1, '2021-01-13 05:56:29'),
(5, 'CJNHpOVJgWV', 2147483647, '\"There’s nothing sadder in this world than to awake Christmas morning and not be a child.\" - Erma Bombeck.\n\nWe would like to wish everyone a Christmas that\'s merry, bright and filled with joy and laughter! 🎁\n\nWith lots of love, from our family at Platinum Code. 🎅\n\n#christmas #digitalmarketing #contentmarketing #marketing #marketingstrategy #marketingdigital #marketingtips #marketingagency #marketingideas #branding #brandingdesign #brandingagency #socialmediatips #socialmediastrategy #socialmediamarketing #socialmediamanager #socialmediamarketing #advertising #advertisingagency #onlinemalaysia #malaysiaonlineshop #malaysiatrulyasia #igreviewmalaysia #viralmalaysia #malaysia #malaysiaku #malaysiaphotographer #kualalumpur #platinumcode #DONE4U', 'https://www.instagram.com/p/CJNHpOVJgWV/', 'https://scontent-sin6-4.cdninstagram.com/v/t51.2885-15/132290677_181594610353306_1640349932661992114_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-sin6-4.cdninstagram.com&_nc_cat=110&_nc_ohc=JCZuMHZC8r4AX8aJFZf&tn=bJ8ylPB-l1eZ-Ffk&edm=ABfd0MgBAAAA&ccb=7-4&oh=00_AT_oNrcc9zX-g9zEPynDiI8m7L1tCjbXrhBi3sMwMxPKsw&oe=628B10EF&_nc_sid=7bff83', -1, '2020-12-25 11:04:56'),
(6, 'CHHG9jXLU2a', 2147483647, 'Giving is the name, receiving is the game.\n\nRather than giving away your products/services for free, you trade them for your prospect\'s time.\n\nOnce they\'re reeled in with your gifts, they start engaging with you and share your kindness with their network. You\'ve built a following.\n\nAt this stage, you change your marketing strategy to activate your followers into fans. They are your conversions and they believe in your true value. Fans consume, share and purchase.\n\nDon\'t be afraid of making small investments that could potentially bring great returns.\n\n#digitalmarketing #contentmarketing #marketing #marketingstrategy #marketingdigital #marketingtips #marketingagency #marketingideas #branding #brandingdesign #brandingagency #socialmediatips #socialmediastrategy #socialmediamarketing #socialmediamanager #socialmediamarketing #advertising #advertisingagency #onlinemalaysia #malaysiaonlineshop #malaysiatrulyasia #igreviewmalaysia #viralmalaysia #malaysia #malaysiaku #malaysiaphotographer #kualalumpur #staysafe #platinumcode #done4u', 'https://www.instagram.com/p/CHHG9jXLU2a/', 'https://scontent-sin6-3.cdninstagram.com/v/t51.2885-15/123626215_204728374423182_8539222366797946421_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-sin6-3.cdninstagram.com&_nc_cat=106&_nc_ohc=SGov6Ryg8g0AX9K3F-8&tn=bJ8ylPB-l1eZ-Ffk&edm=ABfd0MgBAAAA&ccb=7-4&oh=00_AT_BRSxoWWpF_LLwokwbRfXblAz3ykGjD3-L727erv_qhg&oe=628C6FD5&_nc_sid=7bff83', -1, '2020-11-03 10:00:45'),
(7, 'CG6O_lSJbEp', 2147483647, 'Salam Maulidur Rasul 2020/1442H.\n\nSemoga kita sama-sama dapat mendepani cabaran norma baharu dengan membina sebuah komuniti yang mapan demi kesejahteraan negara seperti yang dianjurkan oleh tema sambutan tahun ini.\n\n#StayAtHome : Kekal sihat dan kekal selamat bersama Platinum Code.', 'https://www.instagram.com/p/CG6O_lSJbEp/', 'https://scontent-sin6-4.cdninstagram.com/v/t51.2885-15/123117082_386893249007748_3764190225226643270_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-sin6-4.cdninstagram.com&_nc_cat=100&_nc_ohc=hVu5m1B1dSMAX81aIiw&edm=ABfd0MgBAAAA&ccb=7-4&oh=00_AT-X80ayys4n_ib4-3Ro_Le7nGjIQPsF05aapi8BNuCKtg&oe=628B40CA&_nc_sid=7bff83', -1, '2020-10-29 10:00:48'),
(8, 'CGyuRy8hBDj', 2147483647, 'Four reasons why you should be marketing on social media.\n\nIf you\'re still wondering why you\'re considering digital marketing, this post is for you. ☝️ \n\n#digitalmarketing #contentmarketing #marketing #marketingstrategy #marketingdigital #marketingtips #marketingagency #marketingideas #branding #brandingdesign #brandingagency #socialmediatips #socialmediastrategy #socialmediamarketing #socialmediamanager #socialmediamarketing #advertising #advertisingagency #onlinemalaysia #malaysiaonlineshop #malaysiatrulyasia #igreviewmalaysia #viralmalaysia #malaysia #malaysiaku #malaysiaphotographer #kualalumpur #staysafe #platinumcode #done4u', 'https://www.instagram.com/p/CGyuRy8hBDj/', 'https://scontent-sin6-4.cdninstagram.com/v/t51.2885-15/122552429_150309210139765_8270092911053392960_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-sin6-4.cdninstagram.com&_nc_cat=101&_nc_ohc=EitiEGy5G7YAX-16WjD&edm=ABfd0MgBAAAA&ccb=7-4&oh=00_AT_TdnyuPtoQqenWGBFFwub32EQ2ypM4Rzw0V9V5Zgr2PA&oe=628BFAAE&_nc_sid=7bff83', -1, '2020-10-26 12:00:15');
