INSERT INTO `newsletter_description` (`id`, `newsletter_id`, `language_id`, `title`, `description`) VALUES
(8, 8, 1, 'hi', '<h2>PHP Error Handling</h2>\r\n\r\n<p>When creating scripts and web applications, error handling is an important part. If your code lacks error checking code, your program may look very unprofessional and you may be open to security risks.</p>\r\n\r\n<p>This tutorial contains some of the most common error checking methods in PHP.</p>\r\n\r\n<p>We will show different error handling methods:</p>\r\n\r\n<ul>\r\n	<li>Simple &quot;die()&quot; statements</li>\r\n	<li>Custom errors and error triggers</li>\r\n	<li>Error reporting</li>\r\n</ul>'),
(12, 12, 1, 'Test', '<p>Hai&nbsp;</p>\r\n\r\n<p>1. Product attributes popup not working.<br />\r\n2. In Attributes page, need save &amp; continue button.<br />\r\n3. Inventory option is not working.<br />\r\n4. While removing the customer wrong popup message is poped.<br />\r\n5. In choose image popup, use cancel &quot;X&quot; icon.<br />\r\n6. In choose image popup, Upload image button not working.<br />\r\n7. when logged in, products from another account is in the cart.&nbsp;<br />\r\n8. New Products cannot be saved.<br />\r\n9. In Bill management, Cancel Bill button has wrong popup.</p>'),
(13, 13, 1, 'ssdd', '<p>adsad</p>');
