.org/wiki/File:Football_iu_1996.jpg\\\"><img alt=\\\"Football iu 1996.jpg\\\" src=\\\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b9/Football_iu_1996.jpg/300px-Football_iu_1996.jpg\\\" style=\\\"height:204px; width:300px\\\" /></a>\r\n			<p>The attacking player (No. 10) attempts to kick the ball beyond the opposing team&#39;s goalkeeper, between the goalposts, and beneath the crossbar to score a&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Goal_(sport)\\\" title=\\\"Goal (sport)\\\">goal</a>.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">Highest&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Sports_governing_body\\\" title=\\\"Sports governing body\\\">governing&nbsp;body</a></th>\r\n			<td><a href=\\\"https://en.wikipedia.org/wiki/FIFA\\\" title=\\\"FIFA\\\">FIFA</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">Nicknames</th>\r\n			<td>\r\n			<ul>\r\n				<li>World Game<sup><a href=\\\"https://en.wikipedia.org/wiki/Association_football#cite_note-1\\\">[1]</a></sup></li>\r\n				<li><a href=\\\"https://en.wikipedia.org/wiki/The_Beautiful_Game\\\" title=\\\"The Beautiful Game\\\">The Beautiful Game</a></li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">First played</th>\r\n			<td><a href=\\\"https://en.wikipedia.org/wiki/History_of_association_football\\\" title=\\\"History of association football\\\">Mid-19th century England</a><sup><a href=\\\"https://en.wikipedia.org/wiki/Association_football#cite_note-2\\\">[2]</a></sup><sup><a href=\\\"https://en.wikipedia.org/wiki/Association_football#cite_note-fifa-or-3\\\">[3]</a></sup></td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"2\\\">Characteristics</th>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">Team members</th>\r\n			<td>11 per side (including goalkeeper)</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\"><a href=\\\"https://en.wikipedia.org/wiki/Mixed-sex_sports\\\" title=\\\"Mixed-sex sports\\\">Mixed gender</a></th>\r\n			<td>No, separate competitions</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">Type</th>\r\n			<td><a href=\\\"https://en.wikipedia.org/wiki/Team_sport\\\" title=\\\"Team sport\\\">Team sport</a>,&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Ball_game\\\" title=\\\"Ball game\\\">ball sport</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">Equipment</th>\r\n			<td><a href=\\\"https://en.wikipedia.org/wiki/Ball_(association_football)\\\" title=\\\"Ball (association football)\\\">Football</a>&nbsp;(or soccer ball)&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Shinpad\\\" title=\\\"Shinpad\\\">Shinpads</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">Venue</th>\r\n			<td><a href=\\\"https://en.wikipedia.org/wiki/Football_pitch\\\" title=\\\"Football pitch\\\">Football pitch</a>&nbsp;(also known as football field, football ground, soccer field, soccer pitch or simply &quot;pitch&quot;)</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">Glossary</th>\r\n			<td><a href=\\\"https://en.wikipedia.org/wiki/Glossary_of_association_football_terms\\\" title=\\\"Glossary of association football terms\\\">Glossary of association football</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\\\"2\\\">Presence</th>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\">Country or&nbsp;region</th>\r\n			<td>Worldwide</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\"><a href=\\\"https://en.wikipedia.org/wiki/Olympic_Games\\\" title=\\\"Olympic Games\\\">Olympic</a></th>\r\n			<td>Men&#39;s since the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/1900_Summer_Olympics\\\" title=\\\"1900 Summer Olympics\\\">1900 Olympics</a>&nbsp;and women&#39;s since the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/1996_Summer_Olympics\\\" title=\\\"1996 Summer Olympics\\\">1996 Olympics</a></td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\\\"row\\\"><a href=\\\"https://en.wikipedia.org/wiki/Paralympic_Games\\\" title=\\\"Paralympic Games\\\">Paralympic</a></th>\r\n			<td><a href=\\\"https://en.wikipedia.org/wiki/Paralympic_association_football#Football_5-a-side\\\" title=\\\"Paralympic association football\\\">5-a-side</a>&nbsp;since&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/2004_Summer_Paralympics\\\" title=\\\"2004 Summer Paralympics\\\">2004</a>&nbsp;and&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Paralympic_association_football#Football_7-a-side\\\" title=\\\"Paralympic association football\\\">7-a-side</a>&nbsp;from&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/1984_Summer_Paralympics\\\" title=\\\"1984 Summer Paralympics\\\">1984</a>&nbsp;to&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/2016_Summer_Paralympics\\\" title=\\\"2016 Summer Paralympics\\\">2016</a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Association football</strong>, more commonly known as simply&nbsp;<strong>football</strong>&nbsp;or&nbsp;<strong>soccer</strong>,<sup><a href=\\\"https://en.wikipedia.org/wiki/Association_football#cite_note-4\\\">[a]</a></sup>&nbsp;is a&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Team_sport\\\" title=\\\"Team sport\\\">team sport</a>&nbsp;played with a&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Sphere\\\" title=\\\"Sphere\\\">spherical</a>&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Ball_(association_football)\\\" title=\\\"Ball (association football)\\\">ball</a>&nbsp;between two teams of 11&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Football_player\\\" title=\\\"Football player\\\">players</a>. It is played by approximately 250 million players in over 200 countries and dependencies, making it the world&#39;s most popular sport. The game is played on a rectangular field called a&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Football_pitch\\\" title=\\\"Football pitch\\\">pitch</a>&nbsp;with a&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Goal_(sport)\\\" title=\\\"Goal (sport)\\\">goal</a>&nbsp;at each end. The object of the game is to&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Scoring_in_association_football\\\" title=\\\"Scoring in association football\\\">score more goals</a>&nbsp;than the opposition by moving the ball beyond the goal line into the opposing goal, usually within a time frame of 90 or more minutes.</p>\r\n\r\n<p>Football is played in accordance with a set of rules known as the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Laws_of_the_Game_(association_football)\\\" title=\\\"Laws of the Game (association football)\\\">Laws of the Game</a>. The ball is 68&ndash;70&nbsp;cm (27&ndash;28&nbsp;in) in circumference and known as the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Ball_(association_football)\\\" title=\\\"Ball (association football)\\\">football</a>. The two teams compete to get the ball into the other team&#39;s goal (between the posts and under the bar), thereby scoring a goal. Players are not allowed to touch the ball with hands or arms while it is in play, except for the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Goalkeeper_(association_football)\\\" title=\\\"Goalkeeper (association football)\\\">goalkeepers</a>&nbsp;within the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Penalty_area\\\" title=\\\"Penalty area\\\">penalty area</a>. Players may use any other part of their body to strike or pass the ball and mainly use their feet. The team that has scored more goals at the end of the game is the winner; if both teams have scored an equal number of goals, either a&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Tie_(draw)\\\" title=\\\"Tie (draw)\\\">draw</a>&nbsp;is declared or the game goes into&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Extra_time\\\" title=\\\"Extra time\\\">extra time</a>&nbsp;or a&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Penalty_shootout_(association_football)\\\" title=\\\"Penalty shootout (association football)\\\">penalty shootout</a>, depending on the format of the competition. Each team is led by a&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Captain_(association_football)\\\" title=\\\"Captain (association football)\\\">captain</a>&nbsp;who has only one official responsibility as mandated by the Laws of the Game: to represent their team in the coin toss before kick-off or&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Penalty_kick_(association_football)\\\" title=\\\"Penalty kick (association football)\\\">penalty kicks</a>.<sup><a href=\\\"https://en.wikipedia.org/wiki/Association_football#cite_note-laws51-52-5\\\">[4]</a></sup></p>\r\n\r\n<p>Football is governed internationally by the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/FIFA\\\" title=\\\"FIFA\\\">International Federation of Association Football</a>&nbsp;(FIFA;&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/French_language\\\" title=\\\"French language\\\">French</a>:&nbsp;<em>F&eacute;d&eacute;ration Internationale de Football Association</em>), which organises&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/FIFA_World_Cup\\\" title=\\\"FIFA World Cup\\\">World Cups</a>&nbsp;for men and&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/FIFA_Women%27s_World_Cup\\\" title=\\\"FIFA Women\\\'s World Cup\\\">women</a>&nbsp;every four years.<sup><a href=\\\"https://en.wikipedia.org/wiki/Association_football#cite_note-6\\\">[5]</a></sup>&nbsp;The men&#39;s&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/FIFA_World_Cup\\\" title=\\\"FIFA World Cup\\\">FIFA World Cup</a>&nbsp;has taken place every four years since&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/1930_FIFA_World_Cup\\\" title=\\\"1930 FIFA World Cup\\\">1930</a>, with the exception of 1942 and 1946 tournaments, which were cancelled due to&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/World_War_II\\\" title=\\\"World War II\\\">World War II</a>. Approximately 190&ndash;200 national teams compete in qualifying tournaments within the scope of continental confederations for a place in the finals. The finals tournament is held every four years and involves 32 national teams competing over four weeks.<sup><a href=\\\"https://en.wikipedia.org/wiki/Association_football#cite_note-teams_number-7\\\">[b]</a></sup>&nbsp;It is the most prestigious men&#39;s football tournament in the world, and the most widely viewed and followed sporting event in the world, exceeding the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Olympic_Games\\\" title=\\\"Olympic Games\\\">Olympic Games</a>. Similarly, the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/FIFA_Women%27s_World_Cup\\\" title=\\\"FIFA Women\\\'s World Cup\\\">FIFA Women&#39;s World Cup</a>&nbsp;has been played every four years since&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/1991_FIFA_Women%27s_World_Cup\\\" title=\\\"1991 FIFA Women\\\'s World Cup\\\">1991</a>, though football has been played by women since it has existed. A record-breaking 1.12&nbsp;billion viewers watched the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/2019_FIFA_Women%27s_World_Cup\\\" title=\\\"2019 FIFA Women\\\'s World Cup\\\">2019 FIFA Women&#39;s World Cup</a>&nbsp;in France.<sup><a href=\\\"https://en.wikipedia.org/wiki/Association_football#cite_note-forbes_2019wwc-8\\\">[6]</a></sup></p>\r\n\r\n<p>The most prestigious competitions in European club football are the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/UEFA_Champions_League\\\" title=\\\"UEFA Champions League\\\">UEFA Champions League</a>&nbsp;and&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/UEFA_Women%27s_Champions_League\\\" title=\\\"UEFA Women\\\'s Champions League\\\">UEFA Women&#39;s Champions League</a>, which attract an extensive television audience throughout the world. The final of the men&#39;s tournament has been, in recent years, the most-watched annual sporting event in the world.<sup><a href=\\\"https://en.wikipedia.org/wiki/Association_football#cite_note-9\\\">[7]</a></sup>&nbsp;The top five&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/List_of_top-division_football_clubs_in_UEFA_countries\\\" title=\\\"List of top-division football clubs in UEFA countries\\\">European men&#39;s leagues</a>&nbsp;are the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Premier_League\\\" title=\\\"Premier League\\\">Premier</a></p>', 1, 7),
