INSERT INTO `pages_description` (`page_description_id`, `name`, `description`, `language_id`, `page_id`) VALUES
(156, 'rr-Test', '<h3>English cricket in the 18th and 19th centuries</h3>\r\n\r\n<p><a href=\\\"https://en.wikipedia.org/wiki/File:Francis_Cotes_-_The_young_cricketer_(1768).jpg\\\"><img alt=\\\"\\\" src=\\\"https://upload.wikimedia.org/wikipedia/commons/thumb/a/a9/Francis_Cotes_-_The_young_cricketer_%281768%29.jpg/170px-Francis_Cotes_-_The_young_cricketer_%281768%29.jpg\\\" style=\\\"height:261px; width:170px\\\" /></a></p>\r\n\r\n<p><a href=\\\"https://en.wikipedia.org/wiki/Francis_Cotes\\\" title=\\\"Francis Cotes\\\">Francis Cotes</a>,&nbsp;<em>The Young Cricketer</em>, 1768</p>\r\n\r\n<p>The game underwent major development in the 18th century to become England&#39;s national sport.<sup><a href=\\\"https://en.wikipedia.org/wiki/Cricket#cite_note-38\\\">[37]</a></sup>&nbsp;Its success was underwritten by the twin necessities of patronage and betting.<sup><a href=\\\"https://en.wikipedia.org/wiki/Cricket#cite_note-39\\\">[38]</a></sup>&nbsp;Cricket was prominent in London as early as 1707 and, in the middle years of the century, large crowds flocked to matches on the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Artillery_Ground\\\" title=\\\"Artillery Ground\\\">Artillery Ground</a>&nbsp;in Finsbury.<sup>[<em><a href=\\\"https://en.wikipedia.org/wiki/Wikipedia:Citation_needed\\\" title=\\\"Wikipedia:Citation needed\\\">citation needed</a></em>]</sup>&nbsp;The&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Single_wicket_cricket\\\" title=\\\"Single wicket cricket\\\">single wicket</a>&nbsp;form of the sport attracted huge crowds and wagers to match, its popularity peaking in the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/1748_English_cricket_season\\\" title=\\\"1748 English cricket season\\\">1748 season</a>.<sup><a href=\\\"https://en.wikipedia.org/wiki/Cricket#cite_note-ASW-40\\\">[39]</a></sup>&nbsp;Bowling underwent an evolution around 1760 when bowlers began to&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Pitched_delivery_bowling\\\" title=\\\"Pitched delivery bowling\\\">pitch the ball</a>&nbsp;instead of rolling or skimming it towards the batter. This caused a revolution in bat design because, to deal with the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Bouncing_ball\\\" title=\\\"Bouncing ball\\\">bouncing ball</a>, it was necessary to introduce the modern straight bat in place of the old &quot;hockey stick&quot; shape.<sup><a href=\\\"https://en.wikipedia.org/wiki/Cricket#cite_note-41\\\">[40]</a></sup><sup>[<em><a href=\\\"https://en.wikipedia.org/wiki/Wikipedia:Citation_needed\\\" title=\\\"Wikipedia:Citation needed\\\">citation needed</a></em>]</sup></p>\r\n\r\n<p>The&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Hambledon_Club\\\" title=\\\"Hambledon Club\\\">Hambledon Club</a>&nbsp;was founded in the 1760s and, for the next twenty years until the formation of&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Marylebone_Cricket_Club\\\" title=\\\"Marylebone Cricket Club\\\">Marylebone Cricket Club</a>&nbsp;(MCC) and the opening of&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Lord%27s_Old_Ground\\\" title=\\\"Lord\\\'s Old Ground\\\">Lord&#39;s Old Ground</a>&nbsp;in 1787, Hambledon was both the game&#39;s greatest club and its focal point.<sup>[<em><a href=\\\"https://en.wikipedia.org/wiki/Wikipedia:Citation_needed\\\" title=\\\"Wikipedia:Citation needed\\\">citation needed</a></em>]</sup>&nbsp;MCC quickly became the sport&#39;s premier club and the custodian of the&nbsp;<em><a href=\\\"https://en.wikipedia.org/wiki/Laws_of_Cricket\\\" title=\\\"Laws of Cricket\\\">Laws of Cricket</a></em>. New Laws introduced in the latter part of the 18th century included the three stump wicket and&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Leg_before_wicket\\\" title=\\\"Leg before wicket\\\">leg before wicket</a>&nbsp;(lbw).<sup><a href=\\\"https://en.wikipedia.org/wiki/Cricket#cite_note-WCA63-42\\\">[41]</a></sup></p>\r\n\r\n<p>The 19th century saw&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Underarm_bowling\\\" title=\\\"Underarm bowling\\\">underarm bowling</a>&nbsp;superseded by first&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Roundarm_bowling\\\" title=\\\"Roundarm bowling\\\">roundarm</a>&nbsp;and then&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Overarm_bowling\\\" title=\\\"Overarm bowling\\\">overarm bowling</a>. Both developments were controversial.<sup><a href=\\\"https://en.wikipedia.org/wiki/Cricket#cite_note-43\\\">[42]</a></sup>&nbsp;Organisation of the game at county level led to the creation of the county clubs, starting with&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Sussex_County_Cricket_Club\\\" title=\\\"Sussex County Cricket Club\\\">Sussex</a>&nbsp;in 1839.<sup><a href=\\\"https://en.wikipedia.org/wiki/Cricket#cite_note-44\\\">[43]</a></sup>&nbsp;In December 1889, the eight leading county clubs formed the official&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/County_Championship\\\" title=\\\"County Championship\\\">County Championship</a>, which began in 1890.<sup><a href=\\\"https://en.wikipedia.org/wiki/Cricket#cite_note-AMCS-45\\\">[44]</a></sup></p>', 1, 63);
