INSERT INTO `pages_description` (`page_description_id`, `name`, `description`, `language_id`, `page_id`) VALUES
(180, 'New Content', '<p>This article is about all forms of football. For specific codes of football and other uses of the term, see&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Football_(disambiguation)\\\" title=\\\"Football (disambiguation)\\\">Football (disambiguation)</a>.</p>\r\n\r\n<p><a href=\\\"https://en.wikipedia.org/wiki/File:Football_iu_1996.jpg\\\"><img alt=\\\"\\\" src=\\\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b9/Football_iu_1996.jpg/190px-Football_iu_1996.jpg\\\" style=\\\"height:129px; width:190px\\\" /></a></p>\r\n\r\n<p><a href=\\\"https://en.wikipedia.org/wiki/File:Brent_Grimes-Hamburg_Sea_Devils.jpg\\\"><img alt=\\\"\\\" src=\\\"https://upload.wikimedia.org/wikipedia/commons/thumb/1/15/Brent_Grimes-Hamburg_Sea_Devils.jpg/194px-Brent_Grimes-Hamburg_Sea_Devils.jpg\\\" style=\\\"height:129px; width:194px\\\" /></a></p>\r\n\r\n<p><a href=\\\"https://en.wikipedia.org/wiki/File:Stoppage_in_an_AFL_game.jpg\\\"><img alt=\\\"\\\" src=\\\"https://upload.wikimedia.org/wikipedia/commons/thumb/a/ad/Stoppage_in_an_AFL_game.jpg/192px-Stoppage_in_an_AFL_game.jpg\\\" style=\\\"height:129px; width:192px\\\" /></a></p>\r\n\r\n<p><a href=\\\"https://en.wikipedia.org/wiki/File:Ireland_vs_Georgia,_Rugby_World_Cup_2007_line_up.jpg\\\"><img alt=\\\"\\\" src=\\\"https://upload.wikimedia.org/wikipedia/commons/thumb/7/72/Ireland_vs_Georgia%2C_Rugby_World_Cup_2007_line_up.jpg/192px-Ireland_vs_Georgia%2C_Rugby_World_Cup_2007_line_up.jpg\\\" style=\\\"height:128px; width:192px\\\" /></a></p>\r\n\r\n<p><a href=\\\"https://en.wikipedia.org/wiki/File:Scotland_v_Italy_2013_RLWC_(3).jpg\\\"><img alt=\\\"\\\" src=\\\"https://upload.wikimedia.org/wikipedia/commons/thumb/2/23/Scotland_v_Italy_2013_RLWC_%283%29.jpg/195px-Scotland_v_Italy_2013_RLWC_%283%29.jpg\\\" style=\\\"height:130px; width:195px\\\" /></a></p>\r\n\r\n<p><a href=\\\"https://en.wikipedia.org/wiki/File:Aidan_O%27Mahony_%26_Eoin_Bradley.jpg\\\"><img alt=\\\"\\\" src=\\\"https://upload.wikimedia.org/wikipedia/commons/thumb/e/ea/Aidan_O%27Mahony_%26_Eoin_Bradley.jpg/189px-Aidan_O%27Mahony_%26_Eoin_Bradley.jpg\\\" style=\\\"height:130px; width:189px\\\" /></a></p>\r\n\r\n<p>Several codes of football. Clockwise from top left:&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Association_football\\\" title=\\\"Association football\\\">association</a>,&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Gridiron_football\\\" title=\\\"Gridiron football\\\">gridiron</a>,&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Rugby_union\\\" title=\\\"Rugby union\\\">rugby union</a>,&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Gaelic_football\\\" title=\\\"Gaelic football\\\">Gaelic</a>,&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Rugby_league\\\" title=\\\"Rugby league\\\">rugby league</a>, and&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Australian_rules_football\\\" title=\\\"Australian rules football\\\">Australian rules</a></p>\r\n\r\n<p><strong>Football</strong>&nbsp;is a family of&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Team_sport\\\" title=\\\"Team sport\\\">team sports</a>&nbsp;that involve, to varying degrees,&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Kick_(football)\\\" title=\\\"Kick (football)\\\">kicking</a>&nbsp;a&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Football_(ball)\\\" title=\\\"Football (ball)\\\">ball</a>&nbsp;to score a&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Goal_(sport)\\\" title=\\\"Goal (sport)\\\">goal</a>. Unqualified,&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Football_(word)\\\" title=\\\"Football (word)\\\">the word&nbsp;<em>football</em></a>&nbsp;normally means the form of football that is the most popular where the word is used. Sports commonly called&nbsp;<em>football</em>&nbsp;include&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Association_football\\\" title=\\\"Association football\\\">association football</a>&nbsp;(known as&nbsp;<em>soccer</em>&nbsp;in North America and Oceania);&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Gridiron_football\\\" title=\\\"Gridiron football\\\">gridiron football</a>&nbsp;(specifically&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/American_football\\\" title=\\\"American football\\\">American football</a>&nbsp;or&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Canadian_football\\\" title=\\\"Canadian football\\\">Canadian football</a>);&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Australian_rules_football\\\" title=\\\"Australian rules football\\\">Australian rules football</a>;&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Rugby_union\\\" title=\\\"Rugby union\\\">rugby union</a>&nbsp;and&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Rugby_league\\\" title=\\\"Rugby league\\\">rugby league</a>; and&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Gaelic_football\\\" title=\\\"Gaelic football\\\">Gaelic football</a>.<sup><a href=\\\"https://en.wikipedia.org/wiki/Football#cite_note-1\\\">[1]</a></sup>&nbsp;These various forms of football share to varying extent common origins and are known as&nbsp;<strong>football codes</strong>.</p>\r\n\r\n<p>There are a number of references to traditional, ancient, or prehistoric ball games played in many different parts of the world.<sup><a href=\\\"https://en.wikipedia.org/wiki/Football#cite_note-2\\\">[2]</a></sup><sup><a href=\\\"https://en.wikipedia.org/wiki/Football#cite_note-3\\\">[3]</a></sup><sup><a href=\\\"https://en.wikipedia.org/wiki/Football#cite_note-fifa-or-4\\\">[4]</a></sup>&nbsp;Contemporary codes of football can be traced back to&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/English_public_school_football_games\\\" title=\\\"English public school football games\\\">the codification of these games at English public schools</a>&nbsp;during the 19th century.<sup><a href=\\\"https://en.wikipedia.org/wiki/Football#cite_note-5\\\">[5]</a></sup><sup><a href=\\\"https://en.wikipedia.org/wiki/Football#cite_note-6\\\">[6]</a></sup>&nbsp;The expansion and cultural influence of the&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/British_Empire\\\" title=\\\"British Empire\\\">British Empire</a>&nbsp;allowed these rules of football to spread to areas of British influence outside the directly controlled Empire.<sup><a href=\\\"https://en.wikipedia.org/wiki/Football#cite_note-7\\\">[7]</a></sup>&nbsp;By the end of the 19th century, distinct regional codes were already developing:&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/Gaelic_football\\\" title=\\\"Gaelic football\\\">Gaelic football</a>, for example, deliberately incorporated the rules of local traditional football games in order to maintain their heritage.<sup><a href=\\\"https://en.wikipedia.org/wiki/Football#cite_note-8\\\">[8]</a></sup>&nbsp;In 1888,&nbsp;<a href=\\\"https://en.wikipedia.org/wiki/The_Football_League\\\" title=\\\"The Football League\\\">The Football League</a>&nbsp;was founded in England, becoming the first of many professional football associations. During the 20th century, several of the various kinds of football grew to become some of the most popular team</p>', 1, 74),
(202, 'addcs', '<p>asd</p>', 1, 85),
(208, 'adfasf', '<p>adfadfa</p>', 1, 88);
