(162, 'newuser_template_body', '<h3 style=\\\"text-align:center\\\"><strong>Thanks for signing up/ joining us</strong></h3>\r\n\r\n<p>This is the quintessential Thank you email. Whatever you do,&nbsp;<strong>make sure you set this one up before any other type</strong>.</p>\r\n\r\n<p>When someone registers for your product/service, they engage with your business.</p>\r\n\r\n<p>This is why you should be there on Day 1 to thank them for signing up or joining you.</p>\r\n\r\n<p>Use this email as an opportunity to say something that does not require further action from them.</p>\r\n\r\n<p>At the beginning of the joint journey with your customers, make sure that you&nbsp;<strong>thank them for being there</strong>. So, this first email also works as a welcome email.</p>', '2021-09-17 06:53:08', '2022-07-19 12:22:45'),
